import React, { useState, useEffect } from "react";
import Board from "../components/Board";
import Configuration from "../components/Configuration";
import { api } from "../utils/api";
import { Box, Typography } from "@mui/material";

const Game: React.FC = () => {

  return (
    <Box sx={{ textAlign: "center", py: 5 }}>

      <Board
        boardSize={Number(sessionStorage.getItem('boardSize'))}
        isAI={sessionStorage.getItem('gameMode') === "ai"}
        aiDifficulty={'easy'}
        isTimerEnabled={Boolean(sessionStorage.getItem('isTimerEnabled'))}
        timerDuration={Number(sessionStorage.getItem('timerDuration'))}
        gameMode={'ai'}
      />
    </Box>
  );
};

export default Game;
